import "./App.css";
import React from "react";
import Header from "./Header";
import Home from "./Home";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Routes>
      <div className="App">
        <Route path="/check">
          <Header />
          <Home />
        </Route>
      </div>
    </Routes>
  );
}

export default App;
